import { describe, it, expect, vi } from "vitest";
import { PEX } from "../src/client";

const PDFBase64 = ``;
const PDFBlob = new Blob(
    [Uint8Array.from(atob(PDFBase64), c => c.charCodeAt(0))],
    { type: "application/pdf" }
);

describe("PEX", () => {
    it("POST /print with lines", async () => {
        const pex = new PEX({
            exceptions: false
        });
        const response = await pex.print({
            lines: ["Line 1", { text: 'line 2', bold: true }],
        });
        expect(response.status).toBe("success");
    }, 20_000);

    it("POST /print with file", async () => {
        const pex = new PEX({
            exceptions: false
        });

        const data = new FormData;
        data.set('file', new File([PDFBlob], 'document.pdf',  { type: "application/pdf" }));

        const response = await pex.print(data);
        expect(response.status).toBe("success");
    }, 20_000);
});
